import React, { useState } from "react";
import {
  Search,
  CurrentWeather,
  ForecastWeather,
  Footer,
} from "./components/index";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Search
        textPlaceholder="Search for a place..."
      />
      <CurrentWeather />
      <ForecastWeather />
      <Footer />
    </div>
  );
}

export default App;
